import React from "react";
import Layout from "../components/layout";
import Seo from "../components/seo";
import { fetchAPI } from "../lib/api";

const Home = ({ homepage }) => {
  return (
    <Layout>
      <Seo seo={homepage.seo} />
      <div className="uk-section">
        <div className="uk-container uk-container-large">
          <div>
            <h1 className="uk-heading-medium">
              Olá, eu sou Rafael,
              <br /> desenvolvedor de software fullstack.
            </h1>
            <h4 class="uk-heading-bullet" style={{ fontSize: 24 }}>
              Bem vindo a minha página pessoal, aqui você pode encontrar algumas
              coisinhas que eu escrevo, tutoriais e trabalhos realizados.
            </h4>
            <h5>
              Sou um desenvolvedor 10x com uma vasta experiência de projetos de
              diversos setores, desde e-commerce à simples landing pages. Nos
              projetos ao qual atuei utilizei tecnologias como: javascript,
              react, react native, redux, styled components, python, django,
              node, dentre outras. Já tive pequenas experiências com liderança
              de squads e venho me aperfeiçoando em busca de me tornar um
              dev/gestor melhor.
            </h5>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export async function getStaticProps() {
  // Run API calls in parallel
  const [homepage] = await Promise.all([fetchAPI("/homepage")]);

  return {
    props: { homepage },
    revalidate: 1,
  };
}

export default Home;
